import styled from "styled-components";
import search from "../../images/search.svg";
function Header() {
  return (
    <StHeader>
      <p>엘리트옥션</p>
      <div>
        <img src={search} />
        <button>로그인</button>
      </div>
    </StHeader>
  );
}

export default Header;
const StHeader = styled.header`
  background-color: #afcaff;
  padding: 15px;
  font-size: 1.5rem;
  font-weight: bold;
  display: flex;

  div {
    display: flex;
  }
  img {
    width: 30px;
  }
`;
